!async function(){await Site.loadApplet("double-pendulum-fractal");let e=new DoublePendulumFractal($("#output-canvas"),$("#pendulum-canvas"));function t(){let t=parseInt(n.value||1e3);e.run(t)}let n=$("#resolution-input");e.listenToInputElements([n],t);let a=$("#generate-button");a.addEventListener("click",t);let l=$("#switch-pendulum-canvas-button");l.addEventListener("click",()=>{e.drawingFractal?(e.drawingFractal=!1,Page.Animate.changeOpacity(l,0,Site.opacityAnimationTime).then(()=>{l.textContent="Return to Fractal",Page.Animate.changeOpacity(l,1,Site.opacityAnimationTime)})):(e.drawingFractal=!0,e.hidePendulumDrawerCanvas(),Page.Animate.changeOpacity(l,0,Site.opacityAnimationTime).then(()=>{l.textContent="Pick Pendulum",Page.Animate.changeOpacity(l,1,Site.opacityAnimationTime)}))});let i=$("#download-button");i.addEventListener("click",()=>e.wilson.downloadFrame("the-double-pendulum-fractal.png")),Page.show()}();